pragma solidity ^0.5.0;
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./UserWalletContract.sol";
import "./TokenFactory.sol";
import "./AtaaToken.sol";
import "./YallaGiveAdmins.sol";

/** this contract should manage all type of ChrtyOrgs 
 */
contract Registration   {
    enum Authorization {pending, rejected, approved}
    YallaGiveAdmins public yallaAdmin;
    TokenFactory public factory;
    AtaaToken public attaToken;
    mapping(address => address) public users;
    // struct ChrtyOrg {
    //     address[] ownedTokens;
    //     // address[] orgRequest;
    //     Authorization status;
    // }

    mapping(address => Authorization) chrtyOrgs;

constructor(AtaaToken _attaToken, YallaGiveAdmins _yallaAdmin )public{
        attaToken = _attaToken;
        yallaAdmin = _yallaAdmin;

}
    modifier onlyUnApprovedOrg(address ChrtyOrg){
        require(!isOrg(ChrtyOrg),"Org is already approved");
         _;
    }
    modifier onlyYgAdmin(){
        require(yallaAdmin.isYgAdmin(msg.sender),"Only admin can call this function");
         _;
    }
    // modifier onlyApprovedOrg(address ChrtyOrg){
    //     require(chrtyOrgs[ChrtyOrg].status == Authorization.approved)
    //      _;
    // }
// why you made it payable ?
function setTokenFactoryContract(TokenFactory _factory) public onlyYgAdmin returns (bool){
factory = _factory;
return true;
}

    function createNewAccount() public returns (bool) {// address owner , Registration _registration ,TokenFactory _factory ,IERC20 _attaToken
        address newUser = address(new UserWalletContract(msg.sender,Registration(address(this)),factory,attaToken));
        users[msg.sender] = newUser;
        return true;
    }
    function approveChrtyOrg(address ChrtyOrg) public onlyYgAdmin onlyUnApprovedOrg(ChrtyOrg) returns (bool) {
       chrtyOrgs[ChrtyOrg] = Authorization.approved;
       return true;
   }
//     function chrtyOrgRequest() public  returns (bool) {
