//        return true;
//    }

// TODO :  need to think in whether we have to manage org request on chain or off chain
        function rejectChrtyOrg(address ChrtyOrg) public onlyYgAdmin returns (bool) {
       chrtyOrgs[ChrtyOrg] = Authorization.rejected;
       return true;
   }

